import React from "react";
import Card from "../Card";

const Player = (props) => {
  return (
    //! dùng để canh CSS cho 4 player nằm 4 chỗ
    <div className={`player-${props.index}`}>
      <p className="lead">Player Name</p>
      <main className="d-flex">
        <Card />
        <Card />
        <Card />
      </main>
    </div>
  );
};

export default Player;
